var React = require("react");
var ReactDOM = require("react-dom");
var _ = require("lodash");
var Modal = require("/element/Modal");

require("./style.less");

//{header[], body[[],[]], }
function LoadingClass() {
    this.render = function() {
        // var icon = "data:image/gif;base64,";
        // var icon1 = "data:image/gif;base64,";
        // var icon2 = "data:image/gif;base64,";
        // var icon3 = "data:image/gif;base64,";
        // var icon4 = "data:image/gif;base64,";
        var icon5 = "data:image/gif;base64,";
        var iconText = "data:image/gif;base64,";
        return jade(`
            div(className="cch-loading-fixed")
                div(className="cch-loading")
                    div(className="cch-loading-body")
                        div
                            img(src={icon5})
                        div
                            img(src={iconText})
            `);
    }
}

var Loading = React.createClass(new LoadingClass());

function newLoading() {
    if (this.constructor != newLoading) {
        throw new Error("Loading Must Be Called With New");
    }
    var id = "container-loading-" + Math.floor(Math.random() * 10000);

    this.show = function() {
        var node = $("<div id='" + id + "'></div>");
        $("#container").append(node);
        var loading = jade(`Loading`);
        ReactDOM.render(loading, document.getElementById(id));
    }
    this.hide = function() {
        ReactDOM.unmountComponentAtNode(document.getElementById(id));
        document.getElementById("container").removeChild(document.getElementById(id));
    }
    this.show();
    return this;
}

module.exports = newLoading;
